using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public partial struct SpeedComponentResolver : IResolver<SpeedComponent>, IResolver<SpeedComponentResolver,SpeedComponent>, IData	{		public SpeedComponentResolver In(ref SpeedComponent speedcomponent)		{			return this;		}		public void Out(ref Entity entity)		{			var local = entity.GetComponent<SpeedComponent>();			Out(ref local);		}		public void Out(ref SpeedComponent speedcomponent)		{		}	}}